@use './abstracts';

$hexCoinSize: 39px;



.hexNumbers {
 top: 0px;
 left: 40px;
 font-size: 200%;
 text-align: center;

    $hexNumberzIndex: 500;



    //property used on: top
    $row1: 90px;
    $row2: 230px;
    $row3: 360px;
    $row4: 490px;
    $row5: 610px;

  //property used on: left
    $column1: 330px - 330px;
    $column2: 413px - 330px;
    $column3: 490px - 330px;
    $column4: 567px - 330px;
    $column5: 650px - 330px;
    $column6: 722px - 330px;
    $column7: 801px - 330px;
    $column8: 879px - 330px;
    $column9: 960px - 330px;


    #nA {
       background-color: rgb(190, 192, 79);;
      background-repeat: no-repeat;
      position: absolute;
 border-radius: 33px;

      left: $column3;
      top: $row1;
      width: $hexCoinSize;
      height: $hexCoinSize;
background-size: $hexCoinSize $hexCoinSize;
      z-index: $hexNumberzIndex;
    }

    #nB {
       background-color: rgb(190, 192, 79);;
      background-repeat: no-repeat;
